import React, {useState} from 'react'

function Register() {

  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    password: '',
    confirmPassword: '',
    phone: '',
  });

  const [errors, setErrors] = useState({});
  const [submitted, setSubmitted] = useState(false);

  const validateForm = () => {
    const newErrors = {};
    const nameRegex = /^[a-zA-Z]{2,30}/;
    const phoneRegex = /^[0-9]{10}$/;
    const emailRegex = /^[a-zA-Z0-9._%+-]+@[a-zA-Z]/;
    const passwordRegex = /^(?=.*[0-9](?=.*[!@#$%^&*])[A-Za-z\d@$!%^&*?]{8,20})/;

    if (!formData.firstName || !nameRegex.test(formData.firstName)) {
      newErrors.firstName = 'First name is required and must be 2-30 letters.';
    }

    if (!formData.lastName || !nameRegex.test(formData.lastName)) {
      newErrors.lastName = 'Last name is required and must be 2-30 letters.';
    }

    if (!formData.phone || !phoneRegex.test(formData.phone)) {
      newErrors.phone = 'Phone is required and must be 10 digits';
    }

    if (!formData.email || !emailRegex.test(formData.email)) {
      newErrors.email = 'Email is required must be valid format';
    }

    if (!formData.password || !passwordRegex.test(formData.password)) {
      newErrors.password = 'Password must be 8-20 characters long, contain at least one number and one special characters';
    }

    if (!formData.password !== formData.confirmPassword ) {
      newErrors.confirmPassword = 'Passwod must match';
    }

    setErrors(newErrors);
    //return Object.Keys(newErrors).length === 0;
  }

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // console.log('Form submitted:', formData);
    setSubmitted(true);

    if (validateForm()) {
      console.log('Form submitted:', formData);

      setFormData({
        firstName: '',
        lastName: '',
        phone: '',
        email: '',
        password: '',
        confirmPassword: '',
      });

      setErrors({});
      setSubmitted(false);
    }
  };

  const [password, setPassword] = useState('');
  const [showPassword, setShowPassword] = useState(false);

  const handleTogglePassword = () => {
    setShowPassword(!showPassword);
  }

  const [cpassword, setCPassword] = useState('');
  const [showCPassword, setShowCPassword] = useState(false);

  const handleToggleCPassword = () => {
    setShowCPassword(!showCPassword);
  }


  return (
    <div className="mt-5 mb-5">
      <h2>Signup Form</h2>
      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label htmlFor="firstName" className="form-label">First Name</label>
          <input
            type="text"
            className="form-control"
            id="firstName"
            name="firstName"
            value={formData.firstName}
            onChange={handleChange}
          />
          {submitted && errors.firstName && <span className='text-danger'>{errors.firstName}</span>}
        </div>
        <div className="mb-3">
          <label htmlFor="lastName" className="form-label">Last Name</label>
          <input
            type="text"
            className="form-control"
            id="lastName"
            name="lastName"
            value={formData.lastName}
            onChange={handleChange}
          />
          {submitted && errors.lastName && <span className='text-danger'>{errors.lastName}</span>}
        </div>
        <div className="mb-3">
          <label htmlFor="email" className="form-label">Email</label>
          <input
            type="email"
            className="form-control"
            id="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
          />
          {submitted && errors.email && <span className='text-danger'>{errors.email}</span>}
        </div>
        <div className="mb-3">
          <label htmlFor="phone" className="form-label">Phone</label>
          <input
            type="tel"
            className="form-control"
            id="phone"
            name="phone"
            value={formData.phone}
            onChange={handleChange}
          />
          {submitted && errors.phone && <span className='text-danger'>{errors.phone}</span>}
        </div>
        <div className="mb-3">
          <label htmlFor="password" className="form-label">Password</label>
          <input
            type={showPassword ? 'text' : 'password'}
            className="form-control"
            id="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
          />
          <button type='button' onClick={handleTogglePassword} className='text-primary'>
            {showPassword ? 'Hide' : 'Show'}
          </button>
          {submitted && errors.password && <span className='text-danger'>{errors.password}</span>}
        </div>
        <div className="mb-3">
          <label htmlFor="confirmPassword" className="form-label">Confirm Password</label>
          <input
            type={showCPassword ? 'text' : 'password'}
            className="form-control"
            id="confirmPassword"
            name="confirmPassword"
            value={formData.confirmPassword}
            onChange={handleChange}
          />
          <button type='button' onClick={handleToggleCPassword} className='text-primary'>
            {showCPassword ? 'Hide' : 'Show'}
          </button>
          {submitted && errors.confirmPassword && <span className='text-danger'>{errors.confirmPassword}</span>}
        </div>
        
        <button type="submit" className="btn btn-primary">Submit</button>
      </form>
    </div>
  )
}

export default Register
